import NavLinks from "./NavLinks";
import "./Nav.css";
import { HamburgerIcon } from "react-hamburger-icon";
import Hamburger from 'hamburger-react'

import { useState } from "react";
const MobileNavigation = () => {
  const [open, setOpen] = useState(false);
  const HambIcon = <HamburgerIcon className="Hamburger" onClick={() => setOpen(!open)} />
  const HambCloseIcon = <HamburgerIcon className="Hamburger" onClick={() => setOpen(!open)} />


  return (
    <nav className="MobileNavigation">
      {open && <NavLinks />}
      <HamburgerIcon className="Hamburger" onClick={() => setOpen(!open)} />
      <Hamburger  className="Hamburger" toggled={isOpen} toggle={setOpen}  onClick={() => setOpen(!open)}/>

    </nav>
  );
};
export default MobileNavigation;
